begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(26559445853435643)
,p_plugin_type=>'REGION TYPE'
,p_name=>'COM.APEXBYG.BLOGSPOT.MARKDOWNREGION'
,p_display_name=>'Markdown Region'
,p_supported_ui_types=>'DESKTOP'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('REGION TYPE','COM.APEXBYG.BLOGSPOT.MARKDOWNREGION'),'')
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'  -----------------------------------------------------------------------------',
'  -- FUNCTION f_render',
'  -- %usage: plugin render function',
'  function f_render (p_region              in apex_plugin.t_region',
'                   , p_plugin              in apex_plugin.t_plugin',
'                   , p_is_printer_friendly in boolean)',
'    return apex_plugin.t_region_render_result',
'  is',
'    v_result  apex_plugin.t_region_render_result;',
'    v_js_code varchar2(4000);    ',
'  begin',
'    -- debug',
'    if v(''DEBUG'') = ''YES'' then',
'      apex_plugin_util.debug_region (p_plugin => p_plugin',
'                                   , p_region => p_region);',
'    end if;                             ',
'                ',
'    -- by default HTML is escaped            ',
'    if p_region.escape_output then                                     ',
'      sys.htp.prn(''<div class="markdown-region-wrapper" style="display:none">''||apex_escape.html(p_region.source)||''</div>'');',
'    else',
'      sys.htp.prn(''<div class="markdown-region-wrapper" style="display:none">''||p_region.source||''</div>'');',
'    end if;',
'    ',
'    -- add JS files',
'    apex_javascript.add_library (',
'       p_name                    => ''lib/showdown/showdown''',
'      ,p_directory               => p_plugin.file_prefix',
'      ,p_version                 => null',
'      ,p_check_to_add_minified   => true',
'      ,p_skip_extension          => false',
'      );',
'',
'    apex_javascript.add_library (',
'       p_name                    => ''js/markdown_region/markdown_region''',
'      ,p_directory               => p_plugin.file_prefix',
'      ,p_version                 => null',
'      ,p_check_to_add_minified   => true',
'      ,p_skip_extension          => false',
'      );      ',
'      ',
'    apex_css.add_file (',
'       p_name           => ''css/markdown_region/markdown_region''',
'      ,p_directory      => p_plugin.file_prefix',
'      ,p_version        => null',
'      ,p_skip_extension => false);      ',
'      ',
'    v_js_code := ''apex.jQuery("#''||p_region.static_id||''").markdown_region_plugin({"config":'';',
'    ',
'    -- add init code',
'    if p_region.init_javascript_code is not null then',
'      v_js_code := v_js_code||''(''||p_region.init_javascript_code||'')'';',
'    end if;  ',
'    ',
'    v_js_code := v_js_code||''({}),''||',
'    apex_javascript.add_attribute(''ajaxId'', apex_plugin.get_ajax_identifier, p_add_comma => true)||',
'    apex_javascript.add_attribute(''regionId'', p_region.static_id, p_add_comma => false)||',
'    ''});'';',
'    apex_javascript.add_onload_code (p_code => v_js_code);          ',
'      ',
'    return v_result;',
'  end f_render;  '))
,p_api_version=>2
,p_render_function=>'f_render'
,p_standard_attributes=>'SOURCE_PLAIN:ESCAPE_OUTPUT:INIT_JAVASCRIPT_CODE'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>'More info on https://github.com/mgoricki/apex-plugin-markdown-region'
,p_version_identifier=>'1.0.0'
,p_about_url=>'https://apex.oracle.com/pls/apex/f?p=apexbyg:markdownregion'
,p_files_version=>34
);
