begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(39287570809167960)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'COM.APEXBYG.BLOGSPOT.CODEMIRROR'
,p_display_name=>'CodeMirror'
,p_supported_ui_types=>'DESKTOP'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('ITEM TYPE','COM.APEXBYG.BLOGSPOT.CODEMIRROR'),'')
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'  procedure p_render (',
'    p_item   in            apex_plugin.t_item,',
'    p_plugin in            apex_plugin.t_plugin,',
'    p_param  in            apex_plugin.t_item_render_param,',
'    p_result in out nocopy apex_plugin.t_item_render_result) ',
'  as',
'    v_js_code  varchar2(4000);',
'    v_readonly varchar2(100);',
'  begin',
'    --apex_Debug.enable;',
'',
'    -- debug',
'    if apex_application.g_debug then',
'      apex_plugin_util.debug_page_item(p_plugin              => p_plugin',
'                                     , p_page_item           => p_item);',
'    end if;',
'',
'    if p_param.is_readonly then',
'      v_readonly := ''nocursor'';',
'    else',
'      v_readonly := ''false'';    ',
'    end if;',
'',
'    -- output item',
'    sys.htp.prn(''<textarea id="''||p_item.name||''" name="''||p_item.name||''">''||sys.htf.escape_sc(p_param.value)||''</textarea>'');',
'',
'    -- add files',
'    apex_javascript.add_library (',
'       p_name                    => ''lib/codemirror/codemirror''',
'      ,p_directory               => p_plugin.file_prefix',
'      ,p_version                 => null',
'      ,p_check_to_add_minified   => false',
'      ,p_skip_extension          => false',
'      );',
'',
'    apex_javascript.add_library (',
'       p_name                    => ''lib/codemirror/mode/sql/sql''',
'      ,p_directory               => p_plugin.file_prefix',
'      ,p_version                 => null',
'      ,p_check_to_add_minified   => false',
'      ,p_skip_extension          => false',
'      );      ',
'',
'    apex_javascript.add_library (',
'       p_name                    => ''js/plugins/codemirror/addon/display/fullscreen''',
'      ,p_directory               => p_plugin.file_prefix',
'      ,p_version                 => null',
'      ,p_check_to_add_minified   => true',
'      ,p_skip_extension          => false',
'      );     ',
'',
'    apex_javascript.add_library (',
'       p_name                    => ''lib/codemirror/addon/edit/closebrackets''',
'      ,p_directory               => p_plugin.file_prefix',
'      ,p_version                 => null',
'      ,p_check_to_add_minified   => false',
'      ,p_skip_extension          => false',
'      );           ',
'',
'    apex_javascript.add_library (',
'       p_name                    => ''lib/codemirror/addon/hint/show-hint''',
'      ,p_directory               => p_plugin.file_prefix',
'      ,p_version                 => null',
'      ,p_check_to_add_minified   => false',
'      ,p_skip_extension          => false',
'      );           ',
'',
'    apex_javascript.add_library (',
'       p_name                    => ''js/plugins/codemirror/codemirror_custom''',
'      ,p_directory               => p_plugin.file_prefix',
'      ,p_version                 => null',
'      ,p_check_to_add_minified   => true',
'      ,p_skip_extension          => false',
'      ); ',
'',
'',
'    -- CSS  ',
'    apex_css.add_file (',
'       p_name           => ''lib/codemirror/codemirror''',
'      ,p_directory      => p_plugin.file_prefix',
'      ,p_version        => null',
'      ,p_skip_extension => false); ',
'',
'    apex_css.add_file (',
'       p_name           => ''lib/codemirror/addon/hint/show-hint''',
'      ,p_directory      => p_plugin.file_prefix',
'      ,p_version        => null',
'      ,p_skip_extension => false);      ',
'',
'    apex_css.add_file (',
'       p_name           => ''css/plugins/codemirror/codemirror_custom''',
'      ,p_directory      => p_plugin.file_prefix',
'      ,p_version        => null',
'      ,p_skip_extension => false);',
'',
'',
'    v_js_code := ''apex.jQuery("textarea#''||p_item.name||''").codemirror_plugin({''||',
'      apex_javascript.add_attribute(''readonly'', p_param.is_readonly, p_add_comma => true)||',
'      apex_javascript.add_attribute(''ignoreChanged'', p_item.ignore_change, p_add_comma => true)||',
'      apex_javascript.add_attribute(''ajaxId'', apex_plugin.get_ajax_identifier, p_add_comma => true)||',
'      apex_javascript.add_attribute(''itemName'', p_item.name, p_add_comma => false)||',
'    ''});'';',
'    apex_javascript.add_onload_code (p_code => v_js_code);      ',
'  end p_render;'))
,p_api_version=>2
,p_render_function=>'p_render'
,p_ajax_function=>'p_ajax_call'
,p_standard_attributes=>'VISIBLE:FORM_ELEMENT:SESSION_STATE:READONLY:SOURCE:INIT_JAVASCRIPT_CODE'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>'More info on https://github.com/mgoricki/apex-plugin-code-editor'
,p_version_identifier=>'1.0.1'
,p_about_url=>'https://apex.oracle.com/pls/apex/f?p=apexbyg:codeeditor'
,p_files_version=>1389
);
wwv_flow_api.create_plugin_std_attribute(
 p_id=>wwv_flow_api.id(44376367474542272)
,p_plugin_id=>wwv_flow_api.id(39287570809167960)
,p_name=>'INIT_JAVASCRIPT_CODE'
,p_is_required=>false
);
end;
