'  v_name_array        apex_t_varchar2;',
'  v_split             boolean := true;',
'  v_acl               boolean := true;  ',
'begin',
'  -- create_or_truncate_collection',
'  apex_collection.create_or_truncate_collection(''APP_EXPORT'');',
'  ',
'  -- params',
'  if :P16_SPLIT = ''N'' then',
