'  for i in v_apex_export_files.first..v_apex_export_files.last  ',
'  loop',
'    -- split name',
'    v_name_array := apex_string.split(v_apex_export_files(i).name, ''/'');',
'',
'    apex_collection.add_member(''APP_EXPORT''',
'                             , v_apex_export_files(i).name',
'                             , case when v_name_array.exists(2) then v_name_array(2) else null end                                   ',
'                             , case when v_name_array.exists(3) then v_name_array(3) else null end  ',
